<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 12.0pt; font-family: 'Times New Roman',serif; mso-fareast-font-family: 'Times New Roman'; color: black;">Welcome to Cricket Saga Goods,</span></p>
<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 12.0pt; font-family: 'Times New Roman',serif; mso-fareast-font-family: 'Times New Roman'; color: black;">This store is located in Weligama, the Southern province in Sri-Lanka, and happily serves the large community of cricketers in Southern province and beyond. This store specializes in quality Cricket Equipment and carries the best brands and widest range of cricket goods to satisfy discerning cricketers in the region. </span></p>
<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 12.0pt; font-family: 'Times New Roman',serif; mso-fareast-font-family: 'Times New Roman';">We were one of the online specialist cricket equipment retailers. So we know a bit about online shopping and use this experience to bring our customers a combination of great products at the SLs lowest prices, expert advice and speedy service but at the same time keeping it simple.</span></p>
<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 12.0pt; font-family: 'Times New Roman',serif; mso-fareast-font-family: 'Times New Roman';">Our new site is web responsive meaning you can shop where and when it suits you be it online on your tablet or on your phone.</span></p>
<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 12.0pt; font-family: 'Times New Roman',serif; mso-fareast-font-family: 'Times New Roman';">We pass on the benefits of our significant buying power to you in the form of our lowest SL price guarantee. Beware not all shops operate like this which means our prices and levels of service are way better than most. It's great to have you with us.</span></p></div><div class="clearbreak"></div></div></div></div></div></div>
